import React, { useState, useEffect, useContext } from 'react'
import "./Feladat.css";
import EgyFeladat from './EgyFeladat'


let element

function Feladat(props) {


  const click = (element) => {
    props.feladatokClick(element)
  }

  return (
    <div>
      <div id="feladat" className={props.feladatokVisibility}>
        <h2>{props.feladatok[0]}</h2>
        <div id = 'pickerFeladat'>
          {props.feladatok != undefined ? element = props.feladatok.map((feladat, index) => (<ul key={index} ><EgyFeladat aFeladat = {props.feladatok[index+1]}/></ul>)) : null}
        </div>
      </div>
    </div>
    );


}

export default Feladat;
